import React from 'react';
import { Link, NavLink } from 'react-router-dom';
import Navbar from './Navbar';

function About() {
    return (
        <div className="Center">
            <div>
            <h1>About Me</h1>
            </div>
            <br/>
            <div>
            <p>I've spent a lot of time researching robotics and working with the software aspect of autonomous robots</p>

            </div>

            </div>
      );
}

export default About;
